  false,\n\t\"url\": null,\n\t\"notes\": \"This report is a summary of the results
  of the second annual survey of breeding birds  of Walnut Creek National Wildlife
  Refuge conducted in 1995. This series of surveys  represents the initial inventory
  of breeding birds on the refuge. Information on species  composition and relative
  abundance of birds will be used as a baseline from which to monitor  changes that
  occur as the result of ecosystem reconstruction.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
